  "text" : "\uC784\uADFC\uC900\uC758 21\uC138\uAE30\uC5D0 \uBCA4\uC57C\uBBFC\uC744 \uAEBC\uB0B4\uB4DC\uB294 \uAC74 \uC9C0\uC801 \uD0DC\uB9CC\uC774\uB77C \uC77C\uCE68\uC744 \uB193\uC558\uC744 \uB54C\uB294 \uAC70\uAE30\uC5D0 \uB3D9\uC758\uD588\uC5C8\uB294\uB370, \uB3CC\uC544\uAC00\uB294 \uBAA8\uC591\uC0C8\uB97C \uBCF4\uB2C8\uAE4C \uBA3C\uC9C0\uB97C \uD138\uC5B4\uB0B4\uACE0 \uB2E4\uC2DC \uC9D1\uC5B4\uB4E4 \uD544\uC694\uAC00 \uC788\uC5B4\uBCF4\uC774\uB124\uC694. \uAE30\uC220 \uBC1C\uC804\uC5D0 \uB530\uB77C \uC0AC\uAC74\uC774 \uBC18\uBCF5\uB418\uC9C0\uB9CC \uB354 \uC2EC\uD654\uB418\uACE0 \uC788\uC74C\uC5D0.",
